import styless from "./movieBox.module.css"

function MovieBox({ img, title, overview, vote_average }) {
    return (
        <div className={styless.container}>
            <img src={img} />
            <h2>{title}</h2>
            <p>{vote_average}</p>
        </div>
    )
}

export default MovieBox;
